import React, {useState, useEffect} from "react";
import MyForm from './MyForm';
import './App.css'

function App(){
  const [data, setData] = useState([{}])
  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data=>{
        setData(data)
        console.log(data)
      }
    )
  }, [])
  return (
    <div className="App">
      {(typeof data.members === "undefined") ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => (
          <p key={i}>{member}</p>
        ))
      )}

      <MyForm />
    </div>
  )
}

export default App
